import choiseFragmentForColors from "../../common/common_values/choiseNeedColor";

const tableValuesGroupsSkills = (valuesGroupsSkills, value1, on2) => {
    let tableBody = valuesGroupsSkills.map(el => {
        const estimate = Math.ceil((el.estimate)*100)/100;
        const color = choiseFragmentForColors(el.fragment);
        return (
            <tr>
                <td>{el.name}</td>
                <td>{estimate}</td>
                <td>{el.fragment}</td>
                <td><input type='color' value={this.state.newColorsUGVA[color]}
                                        onChange={this.handleColorChange.bind(this, color)}/>
                </td>
            </tr>
        )
    })

    return(
        <table>
            <thead>
                <tr>
                    <th>Group skills</th>
                    <th>Estimate</th>
                    <th>Fragment</th>
                    <th>Color</th>
                </tr>
            </thead>
            <tbody>
                {tableBody}
            </tbody>
        </table>
    )
}

export default tableValuesGroupsSkills;
